    *(char*)(char_buffer_ptr + (y << 7) + (x)) = 0x27; x++;
    *(char*)(char_buffer_ptr + (y << 7) + (x)) = 0x20; x++;
    *(char*)(char_buffer_ptr + (y << 7) + (x)) = 0x74; x++;
    *(char*)(char_buffer_ptr + (y << 7) + (x)) = 0x6F; x++;
